// App.js
import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

// ==============================
// Home Page
// ==============================
function Home() {
  return (
    <section className="intro">
      <h2>Welcome to the Self-Assessment Hub</h2>
      <p>
        A one-stop platform for guided self-reflection. Explore tools to check
        your well-being, personality, and leadership journey.
      </p>
      <p>
        <b>
          Created by Missions of Hope International – Leadership Development
          Department
        </b>
      </p>
    </section>
  );
}

// ==============================
// Money Personality Quiz Component 
// ==============================
function MoneyPersonalityQuiz() {
  const [questions, setQuestions] = useState([]);
  const [scoring, setScoring] = useState({});
  const [descriptions, setDescriptions] = useState({});
  const [answers, setAnswers] = useState([]);
  const [step, setStep] = useState(0);
  const [result, setResult] = useState(null);

  // Load JSON file
  useEffect(() => {
    import("./assessments/money.json")
      .then((data) => {
        setQuestions(data.default.questions);
        setScoring(data.default.scoring);
        setDescriptions(data.default.descriptions);
        setAnswers(Array(data.default.questions.length).fill(null));
      })
      .catch((err) => console.error("Error loading money.json:", err));
  }, []);

  const handleAnswer = (value) => {
    const updated = [...answers];
    updated[step] = value;
    setAnswers(updated);
    if (step < questions.length - 1) {
      setStep(step + 1);
    } else {
      calculateResult(updated);
    }
  };

  const calculateResult = (finalAnswers) => {
    const totals = {};
    Object.keys(scoring).forEach((type) => (totals[type] = 0));

    Object.entries(scoring).forEach(([type, indices]) => {
      indices.forEach((qIndex) => {
        const ans = finalAnswers[qIndex - 1]; // adjust index
        if (ans) totals[type] += ans;
      });
    });

    const topType = Object.entries(totals).sort((a, b) => b[1] - a[1])[0][0];
    setResult({ type: topType, ...descriptions[topType] });
  };

  const exportCSV = () => {
    if (!result) return;
    const csvContent = `data:text/csv;charset=utf-8,Personality,Characteristics,Strengths,Blindspots\n${result.type},"${result.characteristics}","${result.strengths}","${result.blindspots}"`;
    const link = document.createElement("a");
    link.href = encodeURI(csvContent);
    link.download = "money_personality_result.csv";
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  const progress = Math.round(((step + 1) / questions.length) * 100);

  if (questions.length === 0) return <p>Loading quiz...</p>;

  if (result) {
    return (
      <div className="quiz-result">
        <h3>Your Money Personality: {result.type}</h3>
        <p><b>Characteristics:</b> {result.characteristics}</p>
        <p><b>Strengths:</b> {result.strengths}</p>
        <p><b>Blindspots:</b> {result.blindspots}</p>
        <button onClick={exportCSV}>Download Result as CSV</button>
      </div>
    );
  }

  return (
    <div className="quiz">
      <h3>Question {step + 1} of {questions.length}</h3>
      <p>{questions[step]}</p>
      <div className="options">
        {["Strongly Disagree", "Disagree", "Neutral", "Agree", "Strongly Agree"].map(
          (label, idx) => (
            <button key={idx} onClick={() => handleAnswer(idx + 1)}>
              {label}
            </button>
          )
        )}
      </div>
      <div className="progress-bar">
        <div className="progress" style={{ width: `${progress}%` }}></div>
      </div>
    </div>
  );
}

// ==============================
// Assessments Page with Tabs
// ==============================
function Assessments() {
  const [activeQuiz, setActiveQuiz] = useState(null);

    const quizzes = {
    "Money Personality": () => import("./assessments/money.json"),
    "Burnout Check": () => import("./assessments/burnout.json"),
    "Depression Screening": () => import("./assessments/depression.json"),
    "PTSD Assessment": () => import("./assessments/ptsd.json"),
  };

  return (
    <section className="assessments">
      <h2>Assessments</h2>
      <p>Choose a self-assessment below to begin:</p>
      <div className="tabs">
        {Object.keys(quizContent).map((quiz) => (
          <button
            key={quiz}
            className={activeQuiz === quiz ? "tab active" : "tab"}
            onClick={() => setActiveQuiz(quiz)}
          >
            {quiz}
          </button>
        ))}
      </div>
      <div className="quiz-area">
        {activeQuiz ? quizContent[activeQuiz] : <p>Select an assessment to start.</p>}
      </div>
    </section>
  );
}

// ==============================
// About Page
// ==============================
function About() {
  return (
    <section className="about">
      <h2>About</h2>
      <p>
        The Self-Assessment Hub is designed for MOHI staff and partners as a safe
        space to reflect, grow, and gain insights. It combines different quizzes
        (mental health, personality, leadership, etc.) into one platform for
        convenience.
      </p>
    </section>
  );
}

// ==============================
// Main App
// ==============================
function App() {
  return (
    <Router>
      <div className="App">
        {/* Header Navigation */}
        <header className="header">
          <h1>MOHI Self-Assessment Hub</h1>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/assessments">Assessments</Link></li>
              <li><Link to="/about">About</Link></li>
            </ul>
          </nav>
        </header>

        {/* Routing */}
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/assessments" element={<Assessments />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="footer">
          <p>&copy; {new Date().getFullYear()} Missions of Hope International - Leadership Development Department</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
